// Parse the products array and return individual product items
const inputData = $input.first().json;

// Try multiple possible field names (with and without = prefix)
const productsArray = inputData['=products'] || inputData.products || inputData.data?.products || null;

// Handle both string and array cases
let products;
if (!productsArray) {
  return [];
}

if (typeof productsArray === 'string') {
  try {
    products = JSON.parse(productsArray);
  } catch (e) {
    return [];
  }
} else {
  products = productsArray;
}

// Ensure products is an array
if (!Array.isArray(products)) {
  return [];
}

// Filter out any null or undefined products
// Note: Walmart products use 'name' field, not 'title'
const validProducts = products.filter(product => product && (product.name || product.title));

return validProducts.map(product => ({ json: product }));
